import React from 'react';
import styled, { Keyframes } from 'styled-components';
import Container from '../components/publicComponents/Container';
import { useHistorys } from '../Hooks/useHistorys';
import { slideUp, slideOut } from '../style/keyframes';

const MyPage: React.FC = () => {

    const history = useHistorys();

    return (
        <Container>
            <Screen animation={history.currentPage === 'mypage' ? slideUp : slideOut} >
                asdasd
            </Screen>
        </Container>
    )
}

export default MyPage;

const Screen = styled.div<{ animation: Keyframes }>`
    position: absolute;
    left: 10px;
    bottom: 18px;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    width: 80.5%;
    min-width: 300px;
    /* height: 792px; */
    height: 81.5%;
    border-radius: 30px;
    padding: 10px;
    overflow: auto;
    background-color: ${({ theme }) => theme.colors.black20};
    animation: ${({ animation }) => animation} .5s ease;
    transition: 1s ease;
    z-index: 1;
    @media only screen and (max-width: 500px) {
        width: 96%;
    }
`;
